	const logGoogleUsers = async () => {
		const response = await signInWithGooglePopup();
		var reff = createUserRefDocFromAuth(response);
		console.log(reff);
	};

	return (
		<div className="sign-in">
			<h1>Sign-In</h1>
			<button onClick={logGoogleUsers}>Google Sign In</button>
		</div>
	);
}

export default SignIn;
